import * as React from "react";
import EXPLORER_VIDEO from "./EXPLORER.mp4";
import Video from "../components/Video";

export default {
  title: "Video",
  component: Video,
};

export const FromURL = () => (
  <Video
    width={320}
    src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
    style={{
      marginBottom: 4,
    }}
  />
);
